e. %s broke space constraints showing you real-time and pleasant atmosphere and bringing you the perfect combination of recreation and visual enjoyment by expressing the most realistic live game scenes. Let\'s enjoy %s and join us now!', NULL, 1, 'toby', '2020-02-19 06:15:24', 'toby', '2020-02-19 06:15:24'),
(538, 7, 55, 69, 100, NULL, '彩票遊戲玩法簡單、賠率多元，只要依據彩票獲勝組合且選擇想要下注的數字，開彩後即可獲知中獎相關資訊，包括中國本國3D彩、體彩排列三、上海時時樂、重慶時時樂、江西時時樂、天津時時樂及香港特區六合彩，所有彩票遊戲公正公開，皆參照各地官方開獎結果為依據，連線同步即時開彩。想要讓自己一夜致富的夢想成真嗎?不要錯過機會，下一個千萬富翁很可能就是您，趕緊登入帳號即可隨時參與其中。', '彩票游戏玩法简单、赔率多元，只要依据彩票获胜组合且选择想要下注的数字，开彩后即可获知中奖相关资讯，包括中国本国3D彩、体彩排列三、上海时时乐、重庆时时乐、江西时时乐、天津时时乐及香港特区六合彩，所有彩票游戏公正公开，皆参照各地官方开奖结果为依据，连线同步即时开彩。想要让自己一夜致富的梦想成真吗?不要错过机会，下一个千万富翁很可能就是您，赶紧登入帐号即可随时参与其中。', 'Lottery game is easy to play and has diversified odds. Only need to choose the numbers that you want to bet in the combinations. The player can get the winning information immediately after draw which includes China’s 3D Lotto, Sports Lotto, Shanghai Lotto, Chongqing Lotto, Jiangxi Lotto, Tianjin Lotto and HK Mark Six. All of the lottery games are fair and public. The results are according to the official side of every place, and we also connect with them to get the results immediately. Do you want your dreams come true? Then, don’t miss this chance. The next multimillionaire could be you so please login in and join us now!', '宝くじゲームは手軽いに遊べる、ベットレートも多様性、宝くじの勝組み合わせとベットしたい数字を選び、抽選した後はすぐに当選情報をもらえる、3D宝くじ(3D Lotto)、スポーツ宝くじ（Sports Lotto)、上海宝くじ（Shanghai Lotto）、重慶宝くじ（Chongqing Shishicai）、江西宝くじ（Jiangxi Lotto）、天津宝くじ（Tianjin Lotto）及マークシックス(HK Mark Six)を含みます。すべての宝くじゲームは公正公開、各地のホームページの抽選結果に基づいて、ライブで即時に抽選が行われます。自分が億万長者になる夢を叶えたい？このチャンスを見に逃げない、次の億万長者はあなた様でしょう、今すぐアカウントをログインして一緒に遊ぼう！', '복권게임은 게임 방법이 간단하며, 배당율 또한 다양하여 원하시는 번호를 선택하여 당첨 여부를 바로 확인하실 수 있습니다. 본 게임은 중국3D 복권, 체육복권, 상해시시락, 중경시시락, 강서시시락, 천진시시락 그리고 홍콩 마크식스 등의 게임이 포함되여 있으며, 모든 게임은 절대로 공정, 공평을 원칙으로 해당 지역의 공식 사이트에서 추첨한 번호를 기준으로 진행 하는 게임입니다. 돈벽을 맞고 부자가 되고 싶으신가요?? 이번 기회를 절대로 놓치지 마시기 바랍니다, 망설이지 마시고 지금 당장 로그인하여 복권 게임의 내용을 참조하시기 바랍니다….게임에 참여하는 즉시 다음 억만장자는 바로 당신일 수도 있습니다….', 'Game xổ số: cách chơi game xổ số đơn giản, tỷ lệ cược đa dạng , chỉ cần căn cứ vào tổ hợp thắng của xổ số để chọn lựa con số muốn đặt cược.Sau khi mở thưởng có thể biết ngay thông tin trúng thưởng.Game xổ số bao gồm: xổ số 3D Trung Quốc,xổ số thể thao hàng 3, xổ số Thượng Hải, xổ số Trùng Khánh, xổ số Giang Tây, xổ số Thiên Tân và xổ số tổ hợp 6 Hồng Kong. Tất cả game xổ số đều công khai công bằng, căn cứ vào kết quả mở thưởng chính thức của địa phương để đồng thời kết nối mở thưởng. Bạn muốn mình thực hiện giấc mơ làm giàu trong một đêm hay không? Không nên bỏ lỡ cơ hội, tỷ phú tiếp theo rất có thể là bạn .Hãy nhanh chóng nhập tài khoản để lập tức tham gia nào.', 'เกมหวยมีวิธีการเล่นที่ง่ายและอัตราจ่ายหลากหลาย เพียงแค่เลือกชุดหวยกับตัวเลขที่จะวางเดิมพัน หลังเปิดหวยแล้วจะสามารถตรวจผลหวยได้ทันที เกมหวยที่มีได้แก่หวยจีน3D, หวยกีฬาสามหลัก, หวยเซี่ยงไฮ้, หวยฉงชิ่ง, หวยจางซี, หวยเทียนจินและหวยมาร์คซิสฮ่องกง เกมหวยทั้งหมดจะดำเนินอย่างโปร่งใสและยุติธรรม ผลการเปิดหวยจะอ้างอิงจากการจับสลากของภูมิภาคนั้นๆอย่างเป็นทางการโดยการถ่ายทอดสด อยากผันตัวเองให้เป็นเศรษฐีร้อยล้านหรือไม่? โปรดอย่าพลาดโอกาสนี้ เศรษฐีคนต่อไปอาจเป็นคุณ รีบเข้าร่วมเป็นสมาชิกเพื่อสามารถเล่นเกมได้ตลอดเวลา', 'Lottery game is easy to play and has diversified odds. Only need to choose the numbers that you want to bet in the combinations. The player can get the winning information immediately after draw which includes China’s 3D Lotto, Sports Lotto, Shanghai Lotto, Chongqing Lotto, Jiangxi Lotto, Tianjin Lotto and HK Mark Six. All of the lottery games are fair and public. The results are according to the official side of every place, and we also connect with them to get the results immediately. Do you want your dreams come true? Then, don’t miss this chance. The next multimillionaire could be you so please login in and join us now!', NULL, 1, 'toby', '2020-02-19 06:15:24', 'toby', '2020-02-19 06:15:24'),
