(2458, 8, 57, NULL, NULL, NULL, '點擊【取得】進行檢查會員是否完成首存與存款方式，不會同步計算彩金和參與資格。', NULL, NULL, '【取得】をクリックして会員初入金が完成するかどうかと入金方法を確認します。同時にボーナスのけ計算と参加資格を審査しません。', NULL, 'Nhấp vào [Mua lại] để kiểm tra xem thành viên đã hoàn thành phương thức gửi tiền và gửi tiền đầu tiên chưa và sẽ không tính toán tiền thắng cược và trình độ tham gia đồng thời.', NULL, NULL, NULL, 1, 'toby', '2020-02-19 06:15:26', 'toby', '2020-02-19 06:15:26'),
