(2739, 8, 57, NULL, NULL, NULL, '條件五：總餘額 ≦ (最後一筆的優惠 + 存款) * 優惠餘額放寬設定 %；↵若該筆優惠無存款，則以總餘額 ≦ 最後一筆優惠 * 優惠餘額放寬設定 % 進行判斷', NULL, NULL, '条件五：総残高≦ (最後1件のキャンペーン金額 + 残高) * キャンペーン残高緩め設定%；↵キャンペーンが入金なし場合は、総残高≦最後1件のキャンペーン金額 * キャンペーン残高緩め設定%で判断します。', NULL, 'Điều kiện 5: Tổng số dư (chiết khấu cuối cùng + tiền gửi) * Số dư chiết khấu được đặt thành%; nếu ưu đãi không có tiền gửi, tổng số dư ưu đãi cuối cùng * số dư chiết khấu được đặt thành%', NULL, NULL, NULL, 1, 'toby', '2020-02-19 06:15:26', 'toby', '2020-02-19 06:15:26'),
(2740, 8, 57, NULL, NULL, NULL, '權限等級(用途)：新增後台帳號時，可快速拷貝權限，不設置等級亦可新增後台帳號。', NULL, NULL, '権限レベル（用途）：管理システムアカウントを追加する時に速やかに権限をコッピーしてレベルを設置なくでもアカウントを追加することができます。', NULL, 'Cấp đặc quyền (mục đích): Khi thêm tài khoản nền, bạn có thể nhanh chóng sao chép quyền và bạn có thể thêm tài khoản nền mà không cần đặt cấp.', NULL, NULL, NULL, 1, 'toby', '2020-02-19 06:15:26', 'toby', '2020-02-19 06:15:26'),
(2741, 8, 57, NULL, NULL, NULL, '範例A：會員全帳戶餘額為 50，餘額放寬設定 10 %', NULL, NULL, '例A:会員全アカウント残高は50元 、キャンペーン残高緩め設定10％', NULL, 'Ví dụ A: Số dư tài khoản đầy đủ của thành viên là 50 và số dư được giảm 10%.', NULL, NULL, NULL, 1, 'toby', '2020-02-19 06:15:26', 'toby', '2020-02-19 06:15:26'),
