(3107, 8, 57, NULL, NULL, NULL, '※新增的銀行卡用途選擇<存款或取款>，在支付列表會自動生成可供會員使用的支付方式；', NULL, NULL, '※追加した銀行カード用途では<入金と出金>を選択して、支払いリストは自動的使用できる支払い方法を生成します；', NULL, '※ Tùy chọn sử dụng thẻ ngân hàng mới <gửi hoặc rút tiền> sẽ tự động tạo phương thức thanh toán cho các thành viên sử dụng trong danh sách thanh toán;', NULL, NULL, NULL, 1, 'toby', '2020-02-19 06:15:27', 'toby', '2020-02-19 06:15:27'),
(3108, 8, 57, NULL, NULL, NULL, '若有配合自動認款，可在新增後使用【編輯】調整設定。', NULL, NULL, '自動入金認証が対応する場合は、追加したから【編集】で設定を調整します。', NULL, 'Nếu có thanh toán tự động, bạn có thể sử dụng [Chỉnh sửa] để điều chỉnh cài đặt sau khi thêm.', NULL, NULL, NULL, 1, 'toby', '2020-02-19 06:15:27', 'toby', '2020-02-19 06:15:27'),
(3109, 8, 57, NULL, NULL, NULL, '支付方式新增時均為【停用】，確認開放請至外層【啟用】', NULL, NULL, '追加した支払い方法は【停止】になっています。起用したい場合は外層の【起用】に操作してください', NULL, 'Khi phương thức thanh toán được thêm vào, tất cả đều bị [hủy kích hoạt], vui lòng xác nhận mở vào lớp bên ngoài [Kích hoạt]', NULL, NULL, NULL, 1, 'toby', '2020-02-19 06:15:27', 'toby', '2020-02-19 06:15:27'),
(3110, 8, 57, NULL, NULL, NULL, '請選擇(認款方式)', NULL, NULL, '(入金認証方法)を選択してください', NULL, 'Vui lòng chọn (phương thức nhận dạng)', NULL, NULL, NULL, 1, 'toby', '2020-02-19 06:15:27', 'toby', '2020-02-19 06:15:27'),
(3111, 8, 57, NULL, NULL, NULL, '認款方式或認款平台切換，建議先暫停公司入款24小時後再啟用，確保正確認款。', NULL, NULL, '入金認証方法または入金認証プラットフォーム切り替えについて、口座入金を停止させて24時間以後また起用して正しく入金認証を確保します', NULL, 'Để thay đổi phương thức thanh toán hoặc nền tảng nhận dạng, bạn nên tạm dừng tiền gửi của công ty trong 24 giờ trước khi bật lại để đảm bảo thanh toán được xác nhận.', NULL, NULL, NULL, 1, 'toby', '2020-02-19 06:15:27', 'toby', '2020-02-19 06:15:27'),
