(4743, 8, 57, NULL, NULL, NULL, '3. 請留意<待處理>按鍵僅是標註該單據完成恢復會員出款，已扣金額並不會返還給會員', NULL, NULL, '3. <保留>ボタンは、書類の受け取りをマークして会員の引き出しを元に戻すだけで、差し引かれた金額は会員に返金されません。', NULL, '3. Xin lưu ý rằng nút <Đang chờ xử lý> chỉ đánh dấu việc nhận tài liệu và khôi phục việc rút tiền của thành viên. Số tiền được khấu trừ sẽ không được trả lại cho thành viên.', NULL, NULL, NULL, 1, 'toby', '2020-02-19 06:15:30', 'toby', '2020-02-19 06:15:30'),
(4744, 8, 57, NULL, NULL, NULL, '3. 請留意<待處理>按鍵僅是標註該單據完成恢復代理出款，已扣金額並不會返還給代理', NULL, NULL, '3. <保留>ボタンをクリックすると、回収エージェントの回収を完了するための書類のみがマークされ、差し引かれた金額はエージェントに返却されません。', NULL, '3. Xin lưu ý rằng nút <Đang chờ xử lý> chỉ đánh dấu tài liệu để hoàn tất việc rút tiền của đại lý khôi phục, số tiền được khấu trừ sẽ không được trả lại cho đại lý.', NULL, NULL, NULL, 1, 'toby', '2020-02-19 06:15:30', 'toby', '2020-02-19 06:15:30'),
