(4747, 8, 57, NULL, NULL, NULL, '2. 搜尋此會員的<待處理>取款單， 在確認款項處理完成後點擊<待處理>按鍵，會員即可繼續下一筆出款', NULL, NULL, '2.このメンバーの<保留中>の引き出しフォームを検索し、支払い処理を確認したら、<保留>ボタンをクリックして次の支払いを続けます。', NULL, '2. Tìm kiếm hình thức rút tiền <đang xử lí > của thành viên này. Sau khi xác nhận xử lý thanh toán, nhấp vào nút <đang xư lí> để tiếp tục thanh toán tiếp theo.', NULL, NULL, NULL, 1, 'toby', '2020-02-19 06:15:30', 'toby', '2020-02-19 06:15:30'),
(4748, 8, 57, NULL, NULL, NULL, '2. 搜尋此代理的<待處理>取款單， 在確認款項處理完成後點擊<待處理>按鍵，代理即可繼續下一筆出款', NULL, NULL, '2.このエージェントの<保留中>の引き出しフォームを検索し、支払い処理を確認したら<保留>ボタンをクリックして次の支払いを続行します。', NULL, '2. Tìm kiếm hình thức rút tiền <chờ xử lí> của đại lý này. Sau khi xác nhận xử lý thanh toán, nhấp vào nút <chờ xử lí> để tiếp tục thanh toán tiếp theo.', NULL, NULL, NULL, 1, 'toby', '2020-02-19 06:15:30', 'toby', '2020-02-19 06:15:30'),
