(4757, 8, 57, NULL, NULL, NULL, '※餘額為正數時名單會移除，請至操作紀錄與會員交易紀錄查詢。', NULL, NULL, '※残高がプラスの場合、リストは削除されますので、操作記録、会員取引記録をご確認ください。', NULL, '※ Khi số dư dương, danh sách sẽ bị xóa. Vui lòng kiểm tra hồ sơ hoạt động và hồ sơ giao dịch thành viên.', NULL, NULL, NULL, 1, 'toby', '2020-02-19 06:15:30', 'toby', '2020-02-19 06:15:30'),
(4758, 8, 57, NULL, NULL, NULL, '※當日資料會同步納入統計，建議美東時區跨天後再查詢前一日資料', NULL, NULL, '※当日の統計にはデータが含まれますので、米国東部標準時の日の後に前日の情報を確認することをお勧めします。', NULL, NULL, NULL, NULL, NULL, 1, 'toby', '2020-02-19 06:15:30', 'toby', '2020-02-19 06:15:30'),
