(4762, 8, 57, NULL, NULL, NULL, '※無限層模式：註冊即為代理', NULL, NULL, '※無制限レイヤーモード：登録は代理人です', NULL, '※ Chế độ lớp không giới hạn: đăng ký là đại lý ※ Chế độ lớp không giới hạn: đăng ký là đại lý', NULL, NULL, NULL, 1, 'toby', '2020-02-19 06:15:30', 'toby', '2020-02-19 06:15:30'),
(4763, 8, 57, NULL, NULL, NULL, '※推薦設定後，可應用至前台相關頁面設計', NULL, NULL, '※推奨設定後は、フロントページ関連のページデザインにも適用できます。', NULL, '※ Sau khi cài đặt đề xuất, nó có thể được áp dụng cho thiết kế trang liên quan đến trang trước.', NULL, NULL, NULL, 1, 'toby', '2020-02-19 06:15:30', 'toby', '2020-02-19 06:15:30'),
(4764, 8, 57, NULL, NULL, NULL, '※推薦排序以1~99由小到大排列(預設99)，如序號相同則以系統ID自動排序', NULL, NULL, '※推奨されるソートは小さいものから大きいものへの1から99まで（デフォルトは99）ですシリアル番号が同じであるならば、それはシステムIDによって自動的にソートされます。', NULL, '※ Sắp xếp được khuyến nghị là từ 1 ~ 99 từ nhỏ đến lớn (99 mặc định). Nếu số sê-ri giống nhau, nó sẽ được sắp xếp tự động theo ID hệ thống.', NULL, NULL, NULL, 1, 'toby', '2020-02-19 06:15:30', 'toby', '2020-02-19 06:15:30'),
(4765, 8, 57, NULL, NULL, NULL, '※啟用中修改的內容會同步更新至客端', NULL, NULL, '※アクティベーションで修正した内容は同時にクライアントにも更新されます。', NULL, '※ Nội dung được sửa đổi trong kích hoạt sẽ được cập nhật đồng thời cho khách hàng.', NULL, NULL, NULL, 1, 'toby', '2020-02-19 06:15:30', 'toby', '2020-02-19 06:15:30'),
(4766, 8, 57, NULL, NULL, NULL, '※回補後請至會員資金調整-人工存款紀錄查看明細。', NULL, NULL, '※補充後、詳細を見るには会員基金調整 - 手動入金記録に行ってください。', NULL, '※ Sau khi bổ sung, vui lòng vào phần điều chỉnh quỹ thành viên - hồ sơ ký gửi thủ công để xem chi tiết.', NULL, NULL, NULL, 1, 'toby', '2020-02-19 06:15:30', 'toby', '2020-02-19 06:15:30'),
(4767, 8, 57, NULL, NULL, NULL, '※回補前請先確認其他平台是否存有額度', NULL, NULL, '※補充する前に他のプラットフォームにクォータがあるか確認してください', NULL, '※ Vui lòng xác nhận xem các kênh khác có tồn tại trước khi bổ sung', NULL, NULL, NULL, 1, 'toby', '2020-02-19 06:15:30', 'toby', '2020-02-19 06:15:30'),
