(6052, 8, 57, NULL, NULL, NULL, '超過百款機率遊戲，近年來更積極開發多人對戰遊戲，希望能以豐富的玩法，視覺及聲光效果提供頂級的娛樂享受，給您充滿娛樂享受的遊戲體驗。', '超过百款机率游戏，近年来更积极开发多人对战游戏，希望能以丰富的玩法，视觉及声光效果提供顶级的娱乐享受，给您充满娱乐享受的游戏体验。', 'Over 100 games, in recent years, we focus on development of multiplayer games. We hoping to provide top-level entertainment with rich gameplay, visual and sound effects, giving you a game experience full of entertainment.', '近年、マルチプレイヤーゲームの開発に積極的に取り組んでおり、豊富なゲームの種類、綺麗なグラフィック、臨場感のあるサウンドで、より楽しいゲーム体験を提供していきたいと考えています。', NULL, 'Hơn một trăm trò chơi xác suất, và rất nhiều những trò chơi đối kháng hấp dẫn được tích cực khai thác mấy năm gần đây, hi vọng với hiệu ứng âm thanh, ánh sáng cũng như giác quan đặc sắc, cùng với cách chơi phong phú mang đến cho bạn trải nghiệm giải trí trung thực hấp dẫn nhất.', NULL, NULL, NULL, 1, 'toby', '2020-02-19 06:15:33', 'jin', '2020-08-18 02:58:05'),
(6053, 8, 57, NULL, NULL, NULL, '體育在線投注是線上體育遊戲娛樂性的平台，將體育遊戲賦予遊戲化的多重玩法，以娛樂的形式與互動。不同類別的體育賽事，涵蓋世界範圍內主要體育運動包括足球、美式足球、籃球、羽毛球、棒球、板球、曲棍球、手球、排球等等。', '体育在线投注是线上体育游戏娱乐性的平台，将体育游戏赋予游戏化的多重玩法，以娱乐的形式与互动。不同类别的体育赛事，涵盖世界范围内主要体育运动包括足球、美式足球、篮球、羽毛球、棒球、板球、曲棍球、手球、排球等等。', 'Sports betting is an entertaining platform for online sports games, giving sports games multiple ways of gamification, interacting and interacting in the form of entertainment. Different categories of sports events, includingfootball, American football, basketball, badminton, baseball, cricket, hockey, handball, volleyball and more.', 'オンラインスポーツブックでは、サッカー、アメリカンフットボール、バスケットボール、バドミントン、野球、クリケット、ホッケー、ハンドボール、バレーボールなど、世界中で開催されている、さまざまなスポーツイベントを網羅しています。', NULL, 'Đặt cược thể thao online là một nền tảng game thể thao giải trí online, với cách chơi đa dạng kết hợp giữa hình thức giải trí và tương tác. Đem đến hàng loạt những sự kiện thể thao lớn nhỏ trên toàn thế giới như bóng đá, bóng bầu dục, bóng rổ, cầu lông, bóng chày, bóng gậy (crích-kê), khúc côn cầu, bóng ném, bóng chuyền, v.v.', NULL, NULL, NULL, 1, 'toby', '2020-02-19 06:15:33', 'jin', '2020-08-18 02:58:34'),
(6054, 8, 57, NULL, NULL, NULL, '24小時營運的視訊直播產品，品項多樣為亞洲之冠，以清晰的直播畫面提供百家樂、德州撲克、溫州牌九、輪盤、番攤和骰寶等多款熱門產品，在任何地點都能體驗如親臨現場般刺激愉快的感官享受。', '24小时营运的视讯直播产品，品项多样为亚洲之冠，以清晰的直播画面提供百家乐、德州扑克、温州牌九、轮盘、番摊和骰宝等多款热门产品，在任何地点都能体验如亲临现场般刺激愉快的感官享受。', 'Provide the best 24-hour live broadcast product in Asia. It provides a variety of popular products such as Baccarat, Texas Hold\'em, Wenzhou Pai Gow, Roulette, Fantan and Sic Bo in clear live pictures. You can experience the sensory enjoyment of being as enjoyable as the scene', 'バカラ、テキサスホールデム、パイガオポーカー、ルーレット、ファンチャオ、シェンバオなど、カジノで人気のさまざまなゲームを提供しています。 ライブ映像で興奮と楽しみの感覚を体験してください。', NULL, 'Các trò chơi live stream trên mạng hoạt động 24h, thể loại đa dạng bậc nhất Châu Á, hình ảnh trực tuyến rõ ràng sắc nét, cung cấp các trò chơi phổ biến như Baccarat, bài kiểu Taxas, bài cửu Ôn Châu, Rulet, Fan Tan, và Sic Bo, vv..., ở bất cứ nơi nào cũng trải nghiệm được cảm giác vui vẻ sôi động như đang ở sòng bài thật', NULL, NULL, NULL, 1, 'toby', '2020-02-19 06:15:33', 'jin', '2020-08-18 02:59:07'),
(6055, 8, 57, NULL, NULL, NULL, '創新的節目方式讓彩票產品娛樂升級。 3D時時彩、快樂彩及滾球王，體驗彩票新潮流，開獎走勢勝券在握！', '创新的节目方式让彩票产品娱乐升级。 3D时时彩、快乐彩及滚球王，体验彩票新潮流，开奖走势胜券在握！', 'Innovative programming makes entertainment for lottery products upgrade. BB Quick 3D,KENO and Mark 6, experience the new trend of lottery, the lottery trend wins!', '革新的なプログラムにより、宝くじが楽しめます。 宝くじの新しいトレンドを体験し勝利しましょう！', NULL, 'Hình thức show diễn hoàn toàn mới giúp nâng tầm các game xổ số giải trí. Từ 3D Lotto, Happy Lotto đến BB Running, hãy trải nghiệm xu hướng chơi xổ số mới, xu hướng chơi là thắng!', NULL, NULL, NULL, 1, 'toby', '2020-02-19 06:15:33', 'jin', '2020-08-18 02:59:46'),
