(6072, 8, 57, NULL, NULL, NULL, '用戶須達到居住地國家法律規定之合法年齡方可使用本線上娛樂城。', NULL, 'Users must use the legal age as required by the laws of the country of residence to use this online casino.', 'お客様が当方のサービスをご利用するには、法律上の成人となる年齢を満たしていなければなりません。', NULL, NULL, NULL, NULL, NULL, 1, 'toby', '2020-02-19 06:15:33', 'toby', '2020-02-19 06:15:33'),
