(6074, 8, 57, NULL, NULL, NULL, '任何玩家不論是否下注，出牌途中且尚無結果前自動或強制斷線時，並不影響比賽之結果。', NULL, 'Any player who makes a bet, whether on the way to the card and automatically or forcibly disconnects before the result is in effect, does not affect the outcome of the game.', 'お客様の賭け行為の有無やカード配りの途中や回線落ちなどはゲームの結果に影響しません。', NULL, NULL, NULL, NULL, NULL, 1, 'toby', '2020-02-19 06:15:33', 'toby', '2020-02-19 06:15:33'),
(6075, 8, 57, NULL, NULL, NULL, '如遇發生不可抗拒之災害、駭客入侵、網絡問題造成數據遺失的情況，以本娛樂城公告為最終方案。', NULL, 'In the event of irresistible disasters, hacking, and network problems resulting in data loss, the Entertainment City announcement is the final plan.', '天災、ハッカー、プロバイダーの回線問題など不可抗力によるのデータ紛失問題の解決方法については、当方の告知内容に準じます。', NULL, NULL, NULL, NULL, NULL, 1, 'toby', '2020-02-19 06:15:33', 'toby', '2020-02-19 06:15:33'),
