INSERT INTO `cm_questionask` (`qa_id`, `qa_type`, `qc_id`, `qa_content`, `isflag`, `create_user`, `create_date`, `last_update_user`, `last_update_date`) VALUES
(1, 1, 1, '頁首左上連結是否為自訂連結？', 1, 'bbin', '2019-06-09 16:00:00', 'bbin', '2019-06-09 16:00:00'),
(2, 1, 1, '首頁中間『視訊/電子/體育/彩票/棋盤』的圖檔，有兩個方案，方案一:因遊戲項目都是指引到同一個大廳，建議底圖和上面的遊戲按鈕合併為一張圖，也便於廳主自改；方案二:底圖和遊戲按鈕分開，但無法廳主自改，遊戲項目下架時，按鈕會自行移除，但要新增遊戲項目時，業主需另外派發文案需求新增按鈕。請問要依哪個方案為主呢?', 1, 'bbin', '2019-06-09 16:00:00', 'bbin', '2019-06-09 16:00:00'),
(3, 1, 1, '頁尾會新增BBIN圖示與寰宇瀏覽器ICON，因頁尾空間不足將由ART做調整', 1, 'bbin', '2019-06-09 16:00:00', 'bbin', '2019-06-09 16:00:00'),
(4, 1, 1, '首內頁背景圖，因考量延伸問題，將會左右刷淡處理。', 1, 'bbin', '2019-06-09 16:00:00', 'bbin', '2019-06-09 16:00:00'),
(5, 1, 1, '頁面系統字字型會以微軟雅黑呈現。', 1, 'bbin', '2019-06-09 16:00:00', 'bbin', '2019-06-09 16:00:00'),
(6, 1, 1, '網站內所有中英文皆按照公司規範直接修改。', 1, 'bbin', '2019-06-09 16:00:00', 'bbin', '2019-06-09 16:00:00'),
(7, 1, 1, 'Copyright的文字會以單色呈現，並調整為Copyright © 站名 Reserved。', 1, 'bbin', '2019-06-09 16:00:00', 'bbin', '2019-06-09 16:00:00'),
(8, 1, 1, '將以首頁下方四項遊戲廣告圖作為廳主自改。', 1, 'bbin', '2019-06-09 16:00:00', 'bbin', '2019-06-09 16:00:00'),
(9, 1, 1, '首頁輪播下方視訊和優惠區塊，另外提供的其他圖片內容，因業主無法從後台更新，請確認是否資訊正確？', 1, 'bbin', '2019-06-09 16:00:00', 'bbin', '2019-06-09 16:00:00'),
(10, 1, 1, '頁首自訂連結，可以由後台新增，將無法使用不同ICON，請問是由Art協助調整為統一ICON，還是將ICON移除', 1, 'bbin', '2019-06-09 16:00:00', 'bbin', '2019-06-09 16:00:00'),
(11, 1, 1, '導覽列文字需使用『閃爍』效果，請使用「 黃色/紅色」閃爍效果呈現，因滑入按鈕為黃色，閃爍顏色較不明顯，是否改成別的顏色?', 1, 'bbin', '2019-06-09 16:00:00', 'bbin', '2019-06-09 16:00:00'),
(12, 1, 1, '導航列右上角ICON圖檔，提供檔案中並無動態圖檔，請問是直接使用檔案或業主要重新提供動態檔？', 1, 'bbin', '2019-06-09 16:00:00', 'bbin', '2019-06-09 16:00:00'),
(13, 1, 1, '輪播尺寸示意圖為1440X638與需求單1440X650上不同，請問要依照哪個為主？', 1, 'bbin', '2019-06-09 16:00:00', 'bbin', '2019-06-09 16:00:00'),
